import React from 'react';
import { List, Header } from "semantic-ui-react"


export const Garments = ({ garments }) => {
	return (
		<List>
			{garments.map(garment => {
				return(
					<List.Item key={garment.gtin} key={garment.colorName} key={garment.piecePrice}> 
						<Header>
							Gtin: {garment.gtin}
							Color: {garment.colorName}  
							Price: {(garment.piecePrice *2.5).toFixed(2).toPrecision(2)} 

						</Header>

					</List.Item>
					)
			})}

		</List>

	)
}
